import React from 'react';
import { Link } from 'react-router-dom';
import { motion } from 'framer-motion';
import '../styles/theme.css';

function Dashboard() {
  // Mock data for user balance and matches
  const userBalance = 1000.00;
  const upcomingMatches = [
    { 
      id: 1, 
      player1: 'John Doe', 
      player2: 'Jane Smith', 
      date: '2024-03-20', 
      time: '14:00',
      odds: {
        player1: 1.5,
        player2: 2.5
      }
    },
    { 
      id: 2, 
      player1: 'Mike Johnson', 
      player2: 'Sarah Williams', 
      date: '2024-03-21', 
      time: '15:30',
      odds: {
        player1: 1.8,
        player2: 2.2
      }
    },
    { 
      id: 3, 
      player1: 'David Brown', 
      player2: 'Emily Davis', 
      date: '2024-03-22', 
      time: '16:00',
      odds: {
        player1: 2.0,
        player2: 2.0
      }
    },
  ];

  return (
    <div className="container mt-4">
      {/* Balance Card */}
      <motion.div
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.5 }}
        className="card balance-card mb-4"
      >
        <div className="card-body p-4">
          <div className="d-flex justify-content-between align-items-center">
            <div>
              <h6 className="text-white-50 mb-1">Available Balance</h6>
              <h2 className="text-white mb-0">${userBalance.toFixed(2)}</h2>
            </div>
            <motion.button
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
              className="btn btn-light"
            >
              Add Funds
            </motion.button>
          </div>
        </div>
      </motion.div>

      {/* Matches Section */}
      <h3 className="mb-4">Upcoming Matches</h3>
      <div className="row">
        {upcomingMatches.map((match, index) => (
          <motion.div
            key={match.id}
            className="col-md-6 col-lg-4 mb-4"
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.5, delay: index * 0.1 }}
          >
            <div className="card match-card h-100">
              <div className="card-body">
                <div className="d-flex justify-content-between align-items-center mb-3">
                  <h5 className="card-title mb-0">Match #{match.id}</h5>
                  <span className="badge bg-primary">
                    {match.date} | {match.time}
                  </span>
                </div>
                <div className="text-center mb-4">
                  <div className="d-flex justify-content-between align-items-center">
                    <div className="text-center">
                      <h6 className="mb-2">{match.player1}</h6>
                      <span className="badge bg-light text-dark">Odds: {match.odds.player1}</span>
                    </div>
                    <div className="text-muted">VS</div>
                    <div className="text-center">
                      <h6 className="mb-2">{match.player2}</h6>
                      <span className="badge bg-light text-dark">Odds: {match.odds.player2}</span>
                    </div>
                  </div>
                </div>
                <motion.div
                  whileHover={{ scale: 1.02 }}
                  whileTap={{ scale: 0.98 }}
                >
                  <Link 
                    to={`/match/${match.id}`} 
                    className="btn btn-primary w-100"
                  >
                    Place Bet
                  </Link>
                </motion.div>
              </div>
            </div>
          </motion.div>
        ))}
      </div>
    </div>
  );
}

export default Dashboard;
